(self.webpackChunkeditor_demo=self.webpackChunkeditor_demo||[]).push([[4053],{4053:e=>{e.exports='<div class="sidebar">\n    <div class="sidebar-options">\n        <h2>Table of contents</h2>\n        <div class="table-of-contents">\n            <div\n                *ngFor="let item of contents?.items ?? []"\n                [class.is-active]="item.isActive"\n                [class.is-scrolled-over]="!contents?.isCreate && item.isScrolledOver"\n                [style.--level]="item.level"\n            >\n                <a\n                    routerLink="."\n                    [attr.data-item-index]="item.itemIndex"\n                    [fragment]="item.id"\n                    (click)="onItemClick($event, item)"\n                >\n                    {{ item.textContent }}\n                </a>\n            </div>\n\n            <div\n                *ngIf="!(contents?.items ?? []).length"\n                class="empty-state"\n            >\n                <p>Start editing your document to see the outline.</p>\n            </div>\n        </div>\n    </div>\n</div>\n'}}]);